description:
The Dark Knight XXX - A Porn Parody (2014) 

A better Batman costume than the mainstream, big-budget counterpart... in a porn parody? A Catwoman who is actual capable of kicking ass? Zatanna and John Constantine? Nightwing and Poison Ivy? Batgirl? A spot-on Bane who could take on his Hollywood counterpart and a Joker who's could creep out the lat screen legend? Welcome to a porn parody that raises the bar! Undisputed parody king Axel Braun and Vivid Entertainment bring you another epic exercise filled with the most geekgasmic film spoofing.

Penny Pax, Dani Jensen, Aiden Ashley, Christy Mack, Andy San Dimas, Giovanni Francesco, Brendan Miller, Brian Street Team, Clarke Kent, Derrick Pierce, Tom Byron

Feature, Anal, Spoofs / Parodies, Fantasy &amp; Supernatural

